function minSizeSubarray(nums: number[], target: number): number {
    let sum = 0;
    for (let num of nums) {
        sum += num;
    }

    if (sum === target) return nums.length;
    if (sum < target) return -1;

    let minLen = Infinity;
    let prefixSums = new Map<number, number>();
    prefixSums.set(0, -1);
    let currentSum = 0;

    for (let i = 0; i < nums.length * 2; i++) {
        currentSum += nums[i % nums.length];
        if (prefixSums.has(currentSum - target)) {
            minLen = Math.min(minLen, i - prefixSums.get(currentSum - target)!);
        }
        prefixSums.set(currentSum, i);
    }

    return minLen === Infinity ? -1 : minLen % nums.length === 0 ? nums.length : minLen % nums.length;
}
